    public function ccc(){
        $subsite = M('Subsite')->getfield('s_id',true);
        $page = M('Page')->field('id',true)->where(array('subsite_id'=>0))->select();
        M('Page')->where(array('subsite_id'=>array('neq',0)))->delete();
        foreach($subsite as $val){
            foreach($page as $key=>$v){
                $page[$key]['subsite_id'] = $val;
            }
            M('Page')->addAll($page);
        }
    }
